import React from 'react';
import MyComponent from './components/ViewPoliticas'; // Import your component
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  // Define an array of items
  const items = [
    { name: 'Item 1', description: 'Description for Item 1' },
    { name: 'Item 2', description: 'Description for Item 2' },
    { name: 'Item 3', description: 'Description for Item 3' },
    { name: 'Item 4', description: 'Description for Item 4' },
    { name: 'Item 5', description: 'Description for Item 5' },
    { name: 'Item 6', description: 'Description for Item 5' },
    { name: 'Item 7', description: 'Description for Item 5' },
    { name: 'Item 8', description: 'Description for Item 5' },
    // Add more items as needed
  ];

  return (
    <div className="App">
      <h1>My App</h1>
      {/* Render your MyComponent and pass the 'items' array as props */}
      <div className ="">
        <MyComponent items={items} />
      </div>
    </div>
  );
}

export default App;
